import logo from './logo.svg';
import './App.css';
import items from './component/items';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <items name='Tee-Shirt blanc' price='9.99' picture='shorturl.at/gioQ1'></items>
      </header>
    </div>
  );
}

export default App;
